import Header from "./components/header";
import InstaLoader from "./components/instaLoader";
import RedditLoader from "./components/redditLoader";
import VscoLoader from "./components/vscoLoader";
import styles from "./styles/main.module.css";

function HomePage() {
	return (
		<>
			<div className={styles.header}>
				<Header />
			</div>
			<div className={styles.main}>
				<div className={styles.container}>
					<div className={styles.instaContainer}>
						<InstaLoader />
					</div>
				</div>
				<div className={styles.container}>
					<div className={styles.redditContainer}>
						<RedditLoader />
					</div>
				</div>
				<div className={styles.container}>
					<div className={styles.vscoContainer}>
						<VscoLoader />
					</div>
				</div>

				{/**
                <div className={styles.container}>
                    <div className={styles.youtubeContainer}>
                        <YoutubeLoader />
                    </div>
                </div>
                 */}
			</div>
		</>
	);
}

export default HomePage;
